import React, { Component } from 'react'

export default class List extends Component {
    render() {
        return (
            <ul className="todo-main">
                <li>
                    <label >
                        <input type="checkbox" />
                        <span> 任务1 </span>
                    </label>
                    <button className="btn btn-danger" style={{ display: "none" }}>删除</button>
                </li>

            </ul>
        )
    }
}
